the candlestick body, and the shadow.The body is the part that looks like the body of a candle. The shadow is the part
that looks like a wick. Take a look a the picture below. Candlestick shadows can (and often do) extend from both
the top and bottom of the body.
The body tells you three things:
The opening price
The closing price
Whether the share price went up or down
The shadows tell you the high and low for the time frame. The top shadow gives the high for the period, regardless of
whether the candle is bearish or bullish. The bottom shadow gives the low for the period.
